    /**
     * 加密函数
     *
     * @param content 加密的内容
     * @param strKey  密钥
     * @return 返回加密后的内容
     * @throws Exception
     */
    public static String enCryptAndEncode(String content, String strKey) {
        try {
            KeyGenerator keyGenerator = KeyGenerator.getInstance("AES");
            keyGenerator.init(128, new SecureRandom(strKey.getBytes()));

            SecretKey desKey = keyGenerator.generateKey();
            Cipher cipher = Cipher.getInstance("AES");
            cipher.init(Cipher.ENCRYPT_MODE, desKey);
            byte[] sourceBytes = cipher.doFinal(content.getBytes("UTF-8"));
            return Base64.encodeBase64URLSafeString(sourceBytes);
        } catch (Exception e) {
            LOG.error(e.getMessage(), e);
        }
        return content;
    }

    /**
     * 解密函数
     *
     * @param content 加密过的内容
     * @param strKey  密钥
     * @return 返回加密之前的内容
     * @throws Exception
     */
    public static String deCryptAndDecode(String content, String strKey) {
        try {
            byte[] targetBytes = Base64.decodeBase64(content);
            KeyGenerator keyGenerator = KeyGenerator.getInstance("AES");
            keyGenerator.init(128, new SecureRandom(strKey.getBytes()));

            SecretKey desKey = keyGenerator.generateKey();
            Cipher cipher = Cipher.getInstance("AES");
            cipher.init(Cipher.DECRYPT_MODE, desKey);
            byte[] cByte = cipher.doFinal(targetBytes);
            return new String(cByte, "UTF-8");
        } catch (Exception e) {
            LOG.error(e.getMessage(), e);
        }
        return content;
    }


